import React from "react"
import { Form } from "react-bootstrap"

function EtaUpdate(props) {
    return(
        <Form
        // onSubmit={props.onSubmit}
        >
            <Form.Group>
                <Form.Label>What is you ETA?</Form.Label>
                <Form.Control
                name="time"
                placeholder="0000"
                // type="number"
                // onChange={props.onChange}
                />
            </Form.Group>

        </Form>
    )
} 

export default EtaUpdate
